import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Footer from './Footer';

const Home = () => {
  const navigate = useNavigate();
  const [hoverEffect, setHoverEffect] = useState({ x: 0, y: 0 });
  const [selectedCategory, setSelectedCategory] = useState(null);

  useEffect(() => {
    const handleMouseMove = (e) => {
      const x = (e.clientX - window.innerWidth / 2) / 50;
      const y = (e.clientY - window.innerHeight / 2) / 50;
      setHoverEffect({ x, y });
    };

    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  const categories = [
    {
      title: "Featured Memes",
      description: "Top performing meme tokens of the week",
      icon: "üèÜ",
      color: "from-purple-500 to-pink-500"
    },
    {
      title: "New Launches",
      description: "Fresh memes straight from the kitchen",
      icon: "üöÄ",
      color: "from-blue-500 to-indigo-500"
    },
    {
      title: "Top Gainers",
      description: "Tokens with the highest price increase",
      icon: "üìà",
      color: "from-green-500 to-emerald-500"
    },
    {
      title: "Community Favorites",
      description: "Most liked by our community",
      icon: "‚ù§Ô∏è",
      color: "from-red-500 to-pink-500"
    }
  ];

  const featuredTokens = [
    {
      name: "PEPE 2.0",
      symbol: "PEPE2",
      price: "0.000069 ETH",
      change: "+420%",
      icon: "üê∏"
    },
    {
      name: "Moon Doge",
      symbol: "MDOGE",
      price: "0.00042 ETH",
      change: "+69%",
      icon: "üêï"
    },
    {
      name: "Rocket Shib",
      symbol: "RSHIB",
      price: "0.000089 ETH",
      change: "+169%",
      icon: "üöÄ"
    }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-b from-yellow-300 to-yellow-400 text-gray-800">
      {/* Fun background elements */}
      <div className="fixed inset-0 pointer-events-none overflow-hidden">
        <div className="absolute top-0 left-0 w-full h-full bg-[repeating-linear-gradient(45deg,#FFD700,#FFD700_10px,#FFA500_10px,#FFA500_20px)] opacity-20" />
        {[...Array(15)].map((_, i) => (
          <div
            key={i}
            className="absolute animate-float text-4xl"
            style={{
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              animationDelay: `${Math.random() * 5}s`,
              transform: `rotate(${Math.random() * 360}deg)`
            }}
          >
            {['üöÄ', 'üíé', 'üåï', 'ü¶ç', 'üéÆ'][Math.floor(Math.random() * 5)]}
          </div>
        ))}
      </div>

      {/* Main Content */}
      <div className="relative container mx-auto px-6 py-12">
        {/* Welcome Section */}
        <div className="text-center mb-16">
          <h1 className="text-6xl font-extrabold mb-6">
            <span className="block text-orange-500">Welcome to</span>
            <span className="block text-purple-600">Meme Token Paradise!</span>
          </h1>
          <p className="text-xl text-gray-700 max-w-2xl mx-auto">
            Explore the most entertaining tokens in the crypto universe! 
            Create, trade, and laugh your way to the moon! üöÄ
          </p>
        </div>

        {/* Category Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-16">
          {categories.map((category, index) => (
            <div
              key={index}
              className="bg-white rounded-3xl p-6 shadow-xl transform hover:scale-105 transition-all cursor-pointer"
              onClick={() => setSelectedCategory(category)}
            >
              <div className={`w-16 h-16 rounded-2xl bg-gradient-to-br ${category.color} flex items-center justify-center mb-4`}>
                <span className="text-3xl">{category.icon}</span>
              </div>
              <h3 className="text-xl font-bold mb-2">{category.title}</h3>
              <p className="text-gray-600">{category.description}</p>
            </div>
          ))}
        </div>

        {/* Featured Tokens */}
        <div className="bg-white rounded-3xl p-8 shadow-xl mb-16">
          <h2 className="text-3xl font-bold mb-6 text-purple-600">Featured Tokens üåü</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            {featuredTokens.map((token, index) => (
              <div
                key={index}
                className="bg-gradient-to-br from-orange-400 to-orange-500 rounded-2xl p-6 text-white transform hover:scale-105 transition-all cursor-pointer"
              >
                <div className="flex items-center justify-between mb-4">
                  <span className="text-4xl">{token.icon}</span>
                  <span className="text-sm font-semibold bg-white/20 px-3 py-1 rounded-full">
                    {token.change}
                  </span>
                </div>
                <h3 className="text-xl font-bold mb-1">{token.name}</h3>
                <p className="text-sm text-white/80 mb-2">{token.symbol}</p>
                <p className="text-lg font-semibold">{token.price}</p>
              </div>
            ))}
          </div>
        </div>

        {/* CTA Section */}
        <div className="text-center">
          <button
            onClick={() => navigate('/token-create')}
            className="px-12 py-6 bg-purple-600 text-white rounded-full font-bold text-2xl transform hover:rotate-6 hover:scale-110 transition-all shadow-xl hover:shadow-2xl"
          >
            Create Your Token Now! üé®
          </button>
        </div>
      </div>

      {/* Category Modal */}
      {selectedCategory && (
        <div 
          className="fixed inset-0 bg-black/80 z-50 flex items-center justify-center p-4"
          onClick={() => setSelectedCategory(null)}
        >
          <div 
            className="relative bg-white rounded-3xl max-w-2xl w-full p-8"
            onClick={e => e.stopPropagation()}
          >
            <div className="text-center">
              <div className="text-6xl mb-4">{selectedCategory.icon}</div>
              <h3 className="text-2xl font-bold mb-2">{selectedCategory.title}</h3>
              <p className="text-gray-600">{selectedCategory.description}</p>
            </div>
            <button
              className="absolute top-4 right-4 text-gray-400 hover:text-gray-600"
              onClick={() => setSelectedCategory(null)}
            >
              ‚ùå
            </button>
          </div>
        </div>
      )}

      <Footer />

      <style jsx>{`
        @keyframes float {
          0%, 100% { transform: translateY(0) rotate(0deg); }
          50% { transform: translateY(-20px) rotate(5deg); }
        }
        .animate-float {
          animation: float 3s ease-in-out infinite;
        }
      `}</style>
    </div>
  );
};

export default Home;
